import styled from "styled-components"

const wrap_div = styled.div`
    display: flex;
    justify-content: space-between 5px;
    flex-wrap: wrap;
    gap: 15px;
`;

const Movie_li = styled.li`
    width : 150px;
    height : 300px;
`;



export default {Movie_li, wrap_div};
